import React from "react";

export class RegistrationPage extends React.Component{
    render(){
        return(
            <div className="pagestage">
                <button onClick={this.handleIsInvitedByPhone}>Registration</button>
            </div>
        )
    }

    handleIsInvitedByPhone(){
        const phoneNumber = {
            'phonenumber':'77012345678'
        };
        
        console.log('clicked handleclick inside apps');
        console.log('object: ' + phoneNumber.phonenumber);
        
        const requestOptions = {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(phoneNumber)
        };
        fetch('http://localhost:3001/home?task=sharks', requestOptions)
        .then(console.log('Done with POST'))
        .then(response => console.log(response));
        // .then(data =>console.log('data: ' + data.responded));
    }
}
